import React, { useEffect } from "react";

const getDate = () => {
  useEffect(() => {
    const getData = (date) => {
      let newDate = date.split("-");
      let realDate = newDate[2] + "-" + newDate[1] + "-" + newDate[0];

      return realDate;
    };
    getData();
  }, []);
  return <div></div>;
};

export default getDate;
